style.css:
@-moz-document url-prefix("http://www.tumblr.com"), url-prefix('https://www.tumblr.com')   {

body {
font:normal 14px/1.4 Arial,sans-serif;
}

.notification {
font-family: Arial,sans-serif;
}

.notes {
font-family: Arial,sans-serif;
}

.mceContentBody {
font-family: Arial,sans-serif;
}

.main_content input[type="text"], .main_content textarea {
font-family: Arial,sans-serif;
}

.mceContentBody{margin:8px 12px;padding:0;font-family:Arial,sans-serif;font-size:14px;color:#444;line-height:1.4;font-weight:normal;background:#fff;word-wrap:break-word;-webkit-font-smoothing:antialiased}.mceContentBody a{color:#444;text-decoration:underline}.mceContentBody blockquote{border-left:solid 4px #e4e4e4;margin-left:30px;padding-left:15px;min-width:220px}.mceContentBody img{max-width:100%;height:auto}img.mcePageBreak{border-width:0;height:9px;width:100%;border-top:1px dotted #ccc;background:#fff no-repeat left bottom
}

}
